import React from "react";

export default class OrderList extends React.Component {
    render() {
        const data = this.props.order.map(item => {
            return (
                <div key={item.fishname} className="order">
                    <p>{item.fishname}</p>
                    <p>{item.price}</p>
                    <p>{item.stock}</p>
                    <p>{item.description}</p>
                    <p>{item.image}</p>
                </div>
            )
        })


        return (
            <div>
                {data}
            </div>
        );
    }
}
